import React from 'react';
// import { useHistory } from 'react-router-dom';
// import { Redirect } from 'react-router';
import Footer from '../components/Footer';
import Header from '../components/Header';
import '../styles/Projects.css';

function Projects() {
  const handleClick = (url) => {
    const recipesApp = 'https://camiladamasio.github.io/recipes-app-project/#/';
    window.location.href = recipesApp;
  };

  return (
    <div className="main-div">
      <Header />
      <div className="projects-body">
        <div>
          <h1>Projetos</h1>
        </div>
        <form action="">
          <input
            type="button"
            value="Recipes App"
            onClick={ () => handleClick(recipesApp) }
          />
          <input
            type="button"
            value="Add Courses"
            onClick="window.location.href='Courses.html';"
          />
          <input
            type="button"
            value="Student Payments"
            onClick="window.location.href='Payment.html';"
          />
        </form>
      </div>
      <Footer />
    </div>
  );
}

export default Projects;
